q($,"afo","hW",function(){return H.d([T.QF("Time Spread","This spread is often used for a quick outline of the querent\u2019s past, present and future and gives a very simple and basic insight in what one would find in each time period.\n1. Past \u2013 This card represents the querent\u2019s past.\n2. Present \u2013 This card represents the querent\u2019s present.\n3. Future \u2013 This card represents the querent\u2019s future.",3,"assets/spread_time.png"),T.QF("Dream Spread","This spread is used when the querent inquires about dreams or dream interpretation. It\u2019s customary for the querent to tell the astrologian a brief description of the dream.\n1. How the dream is relevant to the querent\u2019s life.\n2. Lessons the dream is trying to teach the querrent.\n3. How the querent can apply the dream to their daily life.",3,"assets/spread_dream.png"),T.QF("Cross Spread","This spread is the most popular and is intended to shed light on many aspects of the querent\u2019s life. Due to its popularity, it is recommended that the querent focus intently on the question it wishes to ask the cards before the astrologian draws the cards into the spread. This can be done when the astrologian instructs the querent to shuffle and cut the cards.\n1. Signifier \u2013 represents the querent.\n2. Crossing \u2013 represents what is opposing the querrent.\n3. Foundation \u2013 represents the origin of the question.\n4. Recent Past \u2013 represents recent circumstances that contributed the querent to make their inquiry.\n5. Crown \u2013 represents the solution to the problem that may or may not come to pass in the future. This card foretells events depending on how the querent responds to the present situation.\n6. Future \u2013 represents what lies ahead.",6,"assets/spread_cross.png"),T.QF("Guide Spread","This spread is commonly used to answer very specific questions.\n1. Present situation\n2. Cause of conflicts\n3. Changes needed in order to face obstacles\n4. Strengths or Weaknesses\n5. Other challenges\n6. Outcome",6,"assets/spread_guide.png")],H.a1("q<zs*>"))})
